import React, { useEffect, useState } from "react";
import { useSwipeable } from "react-swipeable";
import { Swiper, SwiperSlide } from "swiper/react";
import 'swiper/css';
import 'swiper/css/navigation';
import 'swiper/css/pagination';
import 'swiper/css/scrollbar';

function Worklist() {
  const [rotate, setRotate] = useState(0);

  const handler = useSwipeable({
    onSwipedLeft: () => {
      setRotate(rotate - 90);
    },
    onSwipedRight: () => {
      setRotate(rotate + 90);
    },
    trackMouse: true,
  });

  return (
    <section>
      <div className="container">
        <div className="alums-tit text-center">
          <h2>Our Works</h2>
        </div>
        <div className="ourwrk-bg">
        <Swiper
                        spaceBetween={10}
                        slidesPerView={5}
                        freeMode={true}
                        autoplay
                        breakpoints={{
                          320: {
                            slidesPerView: 1
                          },
                          576: {
                            slidesPerView: 1
                          },
                          992: {
                            slidesPerView: 1
                          },
                          1200: {
                            slidesPerView: 1
                          }
                        }}
                        
                        onSlideChange={() => console.log("slide change")}
                        onSwiper={(swiper) => console.log(swiper)}
                        className="main_slider33"
                      >
                        <SwiperSlide >
                            <div className="wrkbg-img">
                                <img src="\assets\wrkbg1.jpeg" className="img-fluid"/> 
                            </div>
                        </SwiperSlide>
                        <SwiperSlide>
                        <div className="wrkbg-img">
                                <img src="\assets\wrkbg2.webp" className="img-fluid"/> 
                            </div>
                        </SwiperSlide>
                        <SwiperSlide>
                        <div className="wrkbg-img">
                                <img src="\assets\wrkbg3.jpeg" className="img-fluid"/> 
                            </div>
                        </SwiperSlide>
         </Swiper>
        </div>
     
      </div>
    </section>
  );
}

export default Worklist;
